import { createSlice } from "@reduxjs/toolkit";

const questionSlice = createSlice({
  name: "question",
  initialState: {
    character: "",
    url: "",
    level: 0,
    meanings: [],
  },
  reducers: {},
});

export const {} = questionSlice.actions;

export default questionSlice.reducer;
// holds selected kanji, possible answers, answer, etc
